import React from 'react';

const AboutSection = () => (
  <section className="about">
    <h2>About IDC</h2>
    <p>
      <strong>Vision:</strong> To empower developers and connect innovators across India.<br />
      <strong>Mission:</strong> Foster learning, collaboration, and growth in the tech ecosystem.<br />
      <strong>Focus Areas:</strong> Hackathons, Tech News, Learning, Careers, Networking.
    </p>
  </section>
);

export default AboutSection;
